import React from "react";
import "./Navbar.css";
import { Link } from "react-router-dom";

export default function Navbar() {
  return (
    <div>
      <ul>
        <li>
          <a href="/">Home</a>
        </li>
        <li>
          {/* <a href="/about">About</a> */}
          <Link to="/about" />
        </li>
      </ul>
    </div>
  );
}
